    let search_points = [0; 2000].map(|_| {
        let index = rand::thread_rng().gen_range(0..search_point.len());
        search_point[index]
    });

    if let Ok(GeoJson::FeatureCollection(collection)) = polygon_geojson.parse::<GeoJson>() {
        let feature_polygons = collection
            .features
            .into_iter()
            .map(|f| f.try_into())
            .collect::<Result<Vec<PolygonFeature>, _>>()
            .expect("The features were correctly converted");

        let tree = RTree::bulk_load(feature_polygons);

        // let nearest = tree.nearest_neighbors(&search_point);

        let mut cities = vec![];

        let mut times = vec![];
        for search_point in search_points {
            let start_time = Instant::now();
            let intersection = tree
                .locate_at_point(&search_point)
                .and_then(|intersection| intersection.properties.as_ref().unwrap().get("NAME"))
                .map_or("NONE".to_string(), |value| value.to_string());
            cities.push(intersection);
            let elapsed = start_time.elapsed().as_micros();
            // println!(
            //     "Intersection of Point ({}, {}) : {:?} => Time : {} microseconds",
            //     search_point[0], search_point[1], intersection, elapsed
            // );
            times.push(elapsed);
        }
        println!(
            "Elapsed Average Time (Serially) : {} microseconds",
            times.iter().sum::<u128>() as usize / times.len()
        );

        println!(
            "Elapsed Max Time (Serially) : {} microseconds",
            times.iter().max().unwrap()
        );

        let polygon_geojson = parse_geojson_multi_polygon_from_collection(polygon_geojson).unwrap();

        let mut times = vec![];
        for (i, search_point) in search_points.iter().enumerate() {
            let start_time = Instant::now();
            let CityName(intersection) = get_city(
                &Latitude(search_point[1]),
                &Longitude(search_point[0]),
                &polygon_geojson,
            )
            .unwrap_or(CityName("NONE".to_string()));
            let elapsed = start_time.elapsed().as_micros();
            assert_eq!(cities[i], intersection);
            // println!(
            //     "Intersection of Point ({}, {}) : {:?} => Time : {} microseconds",
            //     search_point[0], search_point[1], intersection, elapsed
            // );
            times.push(elapsed);
        }
        println!(
            "Elapsed Average Time (R-Tree) : {} microseconds",
            times.iter().sum::<u128>() as usize / times.len()
        );

        println!(
            "Elapsed Max Time (R-Tree) : {} microseconds",
            times.iter().max().unwrap()
        );
    } else {
        panic!("The geojson did not parse correctly");
    }
